{
  "schemaVersion": "1.0",
  "description": "This document holds parameterized settings for starting a session with Session Manager.",
  "sessionType": "InteractiveCommands",
  "parameters": {
    "s3BucketName": {
      "type": "String",
      "description": "S3 bucket for logging",
      "default": ""
    },
    "s3KeyPrefix": {
      "type": "String",
      "description": "S3 prefix for logging",
      "default": ""
    },
    "s3EncryptionEnabled": {
      "type": "String",
      "description": "Enable S3 Encryption",
      "allowedValues": [
        "true",
        "false"
      ],
      "default": "false"
    },
    "cloudWatchLogGroupName": {
      "type": "String",
      "description": "Cloud watch log group name for logging",
      "default": ""
    },
    "cloudWatchEncryptionEnabled": {
      "type": "String",
      "description": "Enable Cloudwatch Encryption",
      "allowedValues": [
        "true",
        "false"
      ],
      "default": "false"
    },
    "kmsKeyId": {
      "type": "String",
      "description": "KMS key for encryption",
      "default": ""
    },
    "command": {
      "type": "String",
      "description": "The command to run on the instance"
    },
    "maxSessionDuration": {
      "type": "String",
      "description": "The command to run on the instance",
      "default": "250"
	  },
    "idleSessionTimeout": {
      "type": "String",
      "description": "The command to run on the instance",
      "default": "30"
    },
    "runAsDefaultUser": {
      "type": "String",
      "description": "The command to run on the instance",
      "default": ""
    },
	    "runAsEnabled": {
      "type": "String",
      "description": "The command to run on the instance",
      "default": ""
    }
  },
  "inputs": {
    "s3BucketName": "{{s3BucketName}}",
    "s3KeyPrefix": "{{s3KeyPrefix}}",
    "s3EncryptionEnabled": "{{s3EncryptionEnabled}}",
    "cloudWatchLogGroupName": "{{cloudWatchLogGroupName}}",
    "cloudWatchEncryptionEnabled": "{{cloudWatchEncryptionEnabled}}",
    "kmsKeyId": "{{kmsKeyId}}",
    "maxSessionDuration": "250",
    "idleSessionTimeout": "30"
  },
  "properties": {
    "linux": {
      "commands": "{{command}}",
      "runAsElevated": false
    },
    "windows": {
      "commands": "{{command}}",
      "runAsElevated": false
    }
  }
}
